import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

export default function About() {
  return (
    <body className="aboutBody">
      <h1>About Me</h1>
      <p>
        Hi, my name is Mark. Since I was a young boy I was drawn to computers.
        What they could do, how they worked, and all the parts and pieces inside
        intrigued me. I have a long history of work, working various jobs since
        a young age. From a restaurant manager, a gas attendant, a sales lead,
        animator, and now a Software Developer.
      </p>
      <FontAwesomeIcon icon="fa-brands fa-html5" />
      <FontAwesomeIcon icon="fa-brands fa-css3-alt" />
      <FontAwesomeIcon icon="fa-brands fa-js" />
      <FontAwesomeIcon icon="fa-brands fa-node" />
    </body>
  );
}
